Gree + brings you a brand new experience for intelligent control. As a new official application software that Gree  develops specially for IoT era, it has the functions of appliances management, intelligent control, etc., which makes your life much easier.  

Function introductions:
1、Intelligent products can be easily added into Gree ecosystem for intelligent management uniformly;
2、You can control the appliance at anytime and anywhere you like;
3、You can know the status of the appliance in real time and all changes of appliance status will be reported to you immediately。

Ruku is the best free iPhone/iPod remote control application for Roku Streaming Player and Roku TV. All you need is connect your iOS device and Roku to the same Wi-Fi network. You don't have to worry about finding the physical remote.

Main features:
- Automatic detection of Roku device in the Wi-Fi network;
- A large touchpad for convenient menu and content navigation;
- Launching of channels directly from the application;
- Fast & easy keyboard;
- Control your Roku device from Apple Watch;

Compatibility:
- Ruku is compatible with all Roku models including Roku 1, Roku 2, Roku 3, Streaming Stick, Express, Express+, Premiere, Premiere+, Ultra, Roku TV;
- Ruku is compatible with all brands of Roku TV, including TCL, Hisense, Samsung, Sony, VIZIO, Westinghouse, RCA, etc.

